BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "Users" (
	"id"	INTEGER NOT NULL CHECK(typeof("id") = 'integer'),
	"division"	VARCHAR DEFAULT 255,
	"username"	VARCHAR DEFAULT 50,
	"password"	 DEFAULT 70,
	"emp_id"	INTEGER,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "Audit" (
	"audit_id"	INTEGER NOT NULL,
	"emp_id"	INTEGER,
	"date"	VARCHAR DEFAULT (null),
	"status"	VARCHAR,
	PRIMARY KEY("audit_id")
);
CREATE TABLE IF NOT EXISTS "Staff_information" (
	"id"	INTEGER NOT NULL,
	"first_name"	VARCHAR,
	"surname"	VARCHAR,
	"Dob"	INTEGER DEFAULT (null),
	"Email"	VARCHAR,
	"Telephone"	VARCHAR,
	"Address"	VARCHAR,
	"Department"	VARCHAR,
	"Image"	BLOB,
	"Gender"	CHAR,
	"Salary"	VARCHAR,
	"Address2"	VARCHAR,
	"Apartment"	VARCHAR,
	"Post_code"	VARCHAR DEFAULT (null),
	"Designation"	VARCHAR,
	"Status"	VARCHAR,
	"Date_hired"	VARCHAR,
	"job_title"	VARCHAR,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "Deductions" (
	"id"	INTEGER NOT NULL UNIQUE,
	"firstname"	,
	"surname"	,
	"salary"	,
	"deduction_amount"	,
	"deduction_reason"	,
	"emp_id"	VARCHAR,
	"made_by"	VARCHAR,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Allowance" (
	"id"	INTEGER NOT NULL,
	"overtime"	VARCHAR,
	"medical"	VARCHAR,
	"bonus"	VARCHAR,
	"other"	VARCHAR,
	"emp_id"	VARCHAR,
	"salary"	VARCHAR DEFAULT (null),
	"rate"	 DEFAULT (null),
	"total_allowance"	,
	"firstname"	VARCHAR,
	"surname"	,
	"created_by"	VARCHAR,
	PRIMARY KEY("id")
);
